module AnBnCnDnGenerator(
  input        clock,
  input  [3:0] io_sgn,
  input        io_tx_enable,
  input  [2:0] io_tA,
               io_tB,
               io_tC,
               io_tD,
  output [2:0] io_A,
               io_B,
               io_C,
               io_D
);

  reg  tx_enable_n_1;
  reg  tx_enable_n_2;
  reg  tx_enable_n_3;
  reg  tx_enable_n_4;
  wire Srev = tx_enable_n_2 | tx_enable_n_4;
  always @(posedge clock) begin
    tx_enable_n_1 <= io_tx_enable;
    tx_enable_n_2 <= tx_enable_n_1;
    tx_enable_n_3 <= tx_enable_n_2;
    tx_enable_n_4 <= tx_enable_n_3;
  end // always @(posedge)
  assign io_A = io_tA * {{2{io_sgn[0] ^ Srev}}, 1'h1};
  assign io_B = io_tB * {{2{io_sgn[1] ^ Srev}}, 1'h1};
  assign io_C = io_tC * {{2{io_sgn[2] ^ Srev}}, 1'h1};
  assign io_D = io_tD * {{2{io_sgn[3] ^ Srev}}, 1'h1};
endmodule

